import MyButton from "../../Shared/MyButton";

function BlogCards() {
  return (
    <div className='blogCards'>
      <div className='blogCards__con'>
        <h4>News</h4>
        <div className='blogCards__col'>
          <div className='blogCards__one'>
            <h3>HELLO</h3>
            <p>WORLDDDD</p>
          </div>
          <MyButton name='Read More' />
        </div>
      </div>
    </div>
  );
}

export default BlogCards;
